(function(jsPDFAPI) {
  var font =
    "";
  var callAddFont = function() {
    this.addFileToVFS("MathJax_Math-italic-normal.ttf", font);
    this.addFont(
      "MathJax_Math-italic-normal.ttf",
      "mathjax_math-italic",
      "normal"
    );
  };
  jsPDFAPI.events.push(["addFonts", callAddFont]);
})(jsPDF.API);
